import React, { useState,useEffect } from 'react';
import { View, TextInput, Button, Text, StyleSheet, TouchableOpacity } from 'react-native';
import { Ionicons } from '@expo/vector-icons';
// import { useRoute } from "@react-navigation/native";
import axios from 'axios';

const ResetPassword = ({ route, navigation }) => {
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [validationResults, setValidationResults] = useState({
    length: false,
    number: false,
    specialChar: false,
    match: false,
  });
  const [showPassword, setShowPassword] = useState(false);
  const [message, setMessage] = useState(null);

  const handleResetPassword = async () => {
    setMessage(null);

    if (!validatePassword()) {
      return;
    }

    try {
      const response = await axios.post('YOUR_NODE_SERVER_ENDPOINT/reset-password/reset', {
        email: route.params.email,
        token: route.params.token,
        password,
      });

      if (response.data.success) {
        setMessage('Password reset successful. You can now log in with your new password.');
        navigation.navigate('Login');
      } else {
        setMessage('Something went wrong. Please try again later.');
      }
    } catch (error) {
      console.error('Error resetting password:', error.message);
      setMessage('An error occurred while resetting the password.');
    }
  };

  const validatePassword = (input) => {
    const passwordRegex = /^(?=.*[0-9])(?=.*[!@#$%^&*])(.{8,})$/;

    const lengthValid = input.length >= 8;
    const numberValid = /\d/.test(input);
    const specialCharValid = /[!@#$%^&*]/.test(input);
    const matchValid = input === confirmPassword;

    setValidationResults({
      length: lengthValid,
      number: numberValid,
      specialChar: specialCharValid,
      match: matchValid,
    });
  };

  const handlePasswordChange = (text) => {
    setPassword(text);
    validatePassword(text);
  };

  const handleConfirmPasswordChange = (text) => {
    setConfirmPassword(text);
    validatePassword(password);
  };

  return (
    <View style={styles.container}>
      <View style={styles.passwordContainer}>
        <TextInput
          style={styles.input}
          placeholder="Enter New Password"
          secureTextEntry={!showPassword}
          value={password}
          onChangeText={handlePasswordChange}
        />
        <TouchableOpacity style={styles.eyeIcon} onPress={() => setShowPassword(!showPassword)}>
          <Ionicons name={showPassword ? 'eye-off' : 'eye'} size={24} color="black" />
        </TouchableOpacity>
      </View>
      {renderValidationItem('Minimum 8 characters', validationResults.length)}
      {renderValidationItem('At least 1 number', validationResults.number)}
      {renderValidationItem('At least 1 special character', validationResults.specialChar)}
      <View style={styles.passwordContainer}>
        <TextInput
          style={styles.input}
          placeholder="Confirm New Password"
          secureTextEntry={!showPassword}
          value={confirmPassword}
          onChangeText={handleConfirmPasswordChange}
        />
        <TouchableOpacity style={styles.eyeIcon} onPress={() => setShowPassword(!showPassword)}>
          <Ionicons name={showPassword ? 'eye-off' : 'eye'} size={24} color="black" />
        </TouchableOpacity>
      </View>
      {renderValidationItem('Passwords match', validationResults.match)}
      <Button title="Reset Password" onPress={handleResetPassword} style={styles.button} />

      {message && <Text style={styles.message}>{message}</Text>}
    </View>
  );
};

const renderValidationItem = (text, isValid) => (
  <View style={styles.validationItem}>
    <Text style={{ color: isValid ? 'green' : 'red' }}>{isValid ? '✅' : '❌'}</Text>
    <Text style={{ marginLeft: 8 }}>{text}</Text>
  </View>
);

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 16,
  },
  passwordContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 12,
  },
  input: {
    flex: 1,
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    padding: 8,
  },
  eyeIcon: {
    padding: 8,
  },
  validationItem: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 8,
    alignSelf: 'flex-start',
  },
  button: {
    marginTop: 12,
  },
  message: {
    marginTop: 12,
    color: 'red', // or any other color you prefer for error messages
  },
});

export default ResetPassword;
